import React from "react"
import { List } from "antd"
function TopicsList(){
    let {loading,data}= this.props
    return (
        <List
        className="topics_list"
        loading={loading}
        dataSource={data}
        renderItem={(data)=>{
            return <List.Item>
                {data}
            </List.Item>
        }}
        />
    )
}
export default TopicsList;
